description:
Chaque soir Alice ecrit ses secrets dans son journal intime: un homme qui la sodomise en pleine nuit dans son lit, le maitre de maison qui s'envoie en l'air avec une autre fille au pair alors que madame dirige des seances d'initiation au triolisme. 

